const SlimNotifierJs = {
    // Root container
    root: null,
    // Notification list
    notifications: [],
    // CSS-Configurations
    style: {
        rootPosition: {
            zIndex: 1000,
            top: '0',
            right: '0',
            bottom: 'auto',
            left: 'auto',
            marin: '5px 5px 0 0'
        },
        notification: {
            width: '450px',
            iconWidth: '50px',
            maxWidth: '45vw',
            minHeight: '50px',
            borderRadius: '5px',
            boxShadow: '2.5px 2.5px 1px #888888',
            type: {
                simple: {
                    outerBorder: 'none',
                    innerBorder: 'none',
                    textBG: '#8eafbc',
                    iconBG: '#7ea4b3',
                    color: '#eeeeee',
                    titleFontSize: '1.4em',
                    textFontSize: '1em',
                    icon: null
                },
                info: {
                    outerBorder: 'none',
                    innerBorder: 'none',
                    textBG: '#8eafbc',
                    iconBG: '#7ea4b3',
                    color: '#eeeeee',
                    titleFontSize: '1.4em',
                    textFontSize: '1em',
                    icon: 'data:image/png;base64,'
                },
                success: {
                    outerBorder: 'none',
                    innerBorder: 'none',
                    textBG: '#4ed34e',
                    iconBG: '#3ace3a',
                    color: '#eeeeee',
                    titleFontSize: '1.4em',
                    textFontSize: '1em',
                    icon: 'data:image/png;base64,'
                },
                warning: {
                    outerBorder: 'none',
                    innerBorder: 'none',
                    textBG: '#ff9e14',
                    iconBG: '#fa9200',
                    color: '#eeeeee',
                    titleFontSize: '1.4em',
                    textFontSize: '1em',
                    icon: 'data:image/png;base64,'
                },
                error: {
                    outerBorder: 'none',
                    innerBorder: 'none',
                    textBG: '#ff392e',
                    iconBG: '#ff2015',
                    color: '#eeeeee',
                    titleFontSize: '1.4em',
                    textFontSize: '1em',
                    icon: 'data:image/png;base64,'
                }
            }
        }
    },
    // Get configured attribute or a default
    getAttribute: function(configKey, obj, defaultValue) {
        return configKey in obj ? obj[configKey] : defaultValue;
    },
    // Add custom type
    addType: function(name, config) {
        this.style.notification.type[name] = {
            outerBorder: this.getAttribute('outerBorder', config, 'none'),
            innerBorder: this.getAttribute('innerBorder', config, 'none'),
            textBG: this.getAttribute('textBG', config, '#8eafbc'),
            iconBG: this.getAttribute('iconBG', config, '#7ea4b3'),
            color: this.getAttribute('color', config, '#eeeeee'),
            titleFontSize: this.getAttribute('titleFontSize', config, '1.4em'),
            textFontSize: this.getAttribute('textFontSize', config, '1em'),
            icon: this.getAttribute('icon', config, null)
        };
    },
    // Add notification
    notification: function(type, title, text, time=3000, closable=true) {
        var n = document.createElement('div'),
            i = document.createElement('div'),
            c = document.createElement('div'),
            h = document.createElement('div'),
            b = document.createElement('div'),
            x = document.createElement('button'),
            s = this.style, rp = s.rootPosition, sn = s.notification, snt = sn.type[type];
        if(!this.root) {
            this.root = document.createElement('div');
            this.root.style =  `z-index:${rp.zIndex};
                                position:fixed;top:${rp.top};
                                right:${rp.right};
                                bottom:${rp.bottom};
                                left:${rp.left};
                                display:flex;
                                flex-direction:column;`;
            document.body.appendChild(this.root);
        }
        n.style =  `background-color:${snt.textBG};
                    border-radius:${sn.borderRadius};
                    border:${snt.outerBorder};
                    width:${sn.width};
                    max-width:${sn.maxWidth};
                    min-height:${sn.minHeight};
                    color:${snt.color};
                    box-shadow:${sn.boxShadow};
                    display:flex;
                    flex-direction:row;
                    overflow:hidden;
                    margin:${rp.marin}`;
        if(snt.icon != null) {
            i.innerHTML = '&nbsp;';
            i.style =  `width:${sn.iconWidth};
                        min-width:${sn.iconWidth};
                        border-right:${snt.innerBorder};
                        background-color:${snt.iconBG};
                        background-image:url('${snt.icon}');
                        background-size:70% auto;
                        background-position:center;
                        background-repeat:no-repeat;
                        align-items:stretch;
                        display:block;
                        float:left;`;
            n.appendChild(i);
        }
        if(title && title.length != 0) {
            h.innerHTML = title;
            h.style = `font-size:${snt.titleFontSize};font-weight:bold;margin:10px 5px 0 10px;align-items:stretch;`;
            c.appendChild(h);
        }
        if(text && text.length != 0) {
            b.innerHTML = text;
            b.style = `font-size:${snt.textFontSize};margin:0 5px 10px 10px;align-items:stretch;`;
            c.appendChild(b);
        }
        c.style = 'align-items:stretch;display:flex;flex-direction:column;';
        n.appendChild(c);
        var r = this.root;
        if(closable) {
            x.innerHTML = '&#10005';
            x.style.focus
            x.style =  `color:${snt.color};
                        font-size:10px;
                        font-weight:bold;
                        text-align:center;
                        position:absolute;
                        floar:right;
                        right:0;
                        width:40px;
                        background-color:transparent;
                        margin:0;
                        padding0;
                        border:none;
                        cursor:pointer;
                        outline:0!important;`
            x.onclick = function() {
                r.removeChild(n);
            };
            c.appendChild(x);
        }
        if(time) {
            setTimeout(function() { r.removeChild(n); }, time);
        }
        this.root.appendChild(n);
    }
};